import React, { Component } from "react";
import fetch from "isomorphic-unfetch";

class UsersListWithFetch extends Component {
  static async getInitialProps() {
    const res = await fetch("https://reqres.in/api/users?per_page=12");
    //const errorCode = res.statusCode > 200 ? res.statusCode : false;
    const json = await res.json();

    return {
      userList: json.data
    };
  }
  render() {
    console.log(this.userList);
    return (
      <React.Fragment>
        <div className="pricing-header px-3 py-3 pt-md-5 pb-md-4 mx-auto text-center">
          <h1 className="display-4">Isomorpheic Fetch</h1>
          <p className="lead">
            Officia excepteur eu quis deserunt proident nostrud amet
            reprehenderit sit.
          </p>
        </div>
        <table className="table">
          <thead>
            <tr>
              <th scope="col">#</th>
              <th scope="col">Full name</th>
              <th scope="col">Email</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <th scope="row">1</th>
              <td>Mark</td>
              <td>Otto</td>
            </tr>
            <tr>
              <th scope="row">2</th>
              <td>Jacob</td>
              <td>Thornton</td>
            </tr>
            <tr>
              <th scope="row">3</th>
              <td>Larry</td>
              <td>the Bird</td>
            </tr>
          </tbody>
        </table>
      </React.Fragment>
    );
  }
}

export default UsersListWithFetch;
